package com.dong.SE.leetCode;

import java.util.HashMap;
import java.util.HashSet;
import java.util.Map;
import java.util.Set;

/**
 * @author dfx
 */
@SuppressWarnings("all")
public class Test242 {
    public static void main(String[] args) {
        String s = "";
        String t = "";

        System.out.println(isAnagram(s, t));

    }

    public static boolean isAnagram(String s, String t) {
        if(s.length() != t.length()){
            return false;
        }
        Map<Character, Integer> map1 = new HashMap<Character, Integer>();
        Map<Character, Integer> map2 = new HashMap<Character, Integer>();

        for(int i = 0; i < s.length(); i++){
            if(map1.get(s.charAt(i)) != null){
                int count = map1.get(s.charAt(i));
                map1.put(s.charAt(i), ++count);
            }else{
                map1.put(s.charAt(i), 1);
            }
        }
        for(int i = 0; i < t.length(); i++){
            if(map2.get(t.charAt(i)) != null){
                int count = map2.get(t.charAt(i));
                map2.put(t.charAt(i), ++count);
            }else{
                map2.put(t.charAt(i), 1);
            }
        }


        boolean falg = true;
        for(int i = 0; i < s.length(); i++){
            int a = map1.get(s.charAt(i));
            int b = map2.get(s.charAt(i));
            if(a != b){

                falg = false;
                return false;
            }
        }
        return true;
    }

    public int[] intersection(int[] arr1, int[] arr2) {
        Map<Integer, Integer> map1 = new HashMap<Integer, Integer>();
        Map<Integer, Integer> map2 = new HashMap<Integer, Integer>();
        for (int i = 0; i < arr1.length; i++){
            map1.put(arr1[i],1);
        }
        for (int i = 0; i < arr2.length; i++){
            map2.put(arr2[i],1);
        }
        Set<Integer> set = new HashSet<Integer>();
        for (int i = 0; i < arr1.length; i++){
            if(map2.get(arr1[i]) != null){
                set.add(arr1[i]);
            }
        }
        Object[] objects = set.toArray();
        int size = set.size();
        int[] result = new int[size];
        for(int i = 0; i < objects.length; i++){
            result[i] = (int)objects[i];
        }

        return result;

    }
}
